import "./App.css";
import Main from "./view/Main";
import Get_one from "./components/show_recipe";
import Update from "./components/update_recipe";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
          <Routes>
              <Route path="/" element={<Main/>} />
              <Route path="/recipe/:id" element={<Get_one/>}/> 
              <Route path="/recipe/edit/:id" element={<Update/>}/> 
          </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
